import { StyleSheet } from "react-native"

export const styles = StyleSheet.create({
  container: {
    flexGrow: 1,
  },
  header: {
    height: 141,
    backgroundColor: "#FFFFFF",
    paddingHorizontal: 32,
    marginTop: 27,
    justifyContent: "center",
  },
  body: {
    flexGrow: 1,    
  },
  bodyContent: {
    paddingTop: 30,
    paddingHorizontal: 30,
  },
});

export default styles;
